const Order = () =>{const { categoryName, categoryId } = category;
const [products, setProducts] = useState([]);
useEffect(() => {
GET_ALL(`products/getlatest?categoryid=${categoryId}`).then((item) =>
setProducts(item.data)
);
}, [categoryId]);}
